import React, { Component } from 'react';

import Container from '../Container';
import * as C from './style';

class Cell extends Component {
  render() {
    const { id, children, direction, grow } = this.props;

    if (children) {
      return (
        <Container
          id={id}
          children={children}
          direction={direction}
          grow={grow}
        ></Container>
      );
    } else {
      return <C.Wrapper id={id} grow={grow} />;
    }
  }
}

export default Cell;
